import { useEffect, useState } from "react"
function Cardata(){
    const [cars, setcars] = useState('')
    const [loadingcar, setloadingcar] =useState(false)
   useEffect(() => {
    fetch()
    .then(response =>{
      if(response.ok){
        return response.json()
      }
      throw response;
    })
    .then(data =>{
      setcars(data);

    })
    .finally(() =>{
      setloadingcar(false)
    })
   },[],)
    return (
      [cars,setcars]
    )
}

export default Cardata
